import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-tli-root" dir="${ifDefined(context.effectiveDir)}"><div class="${classMap(context.classes.indicator)}"><div class="ui5-tli-icon-outer">${ context.icon ? block1(context) : block2(context) }</div></div><div class="ui5-tli-bubble" tabindex="${ifDefined(context._tabIndex)}" role="option" data-sap-focus-ref><div class="ui5-tli-title">${ context.name ? block3(context) : undefined }<span>${ifDefined(context.titleText)}</span></div><div class="ui5-tli-subtitle">${ifDefined(context.subtitleText)}</div>${ context.textContent ? block6(context) : undefined }<span class="${classMap(context.classes.bubbleArrowPosition)}"></span></div></div>`; };
const block1 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} class="ui5-tli-icon" name="${ifDefined(context.icon)}"></${scopeTag("ui5-icon", tags, suffix)}>`; };
const block2 = (context) => { return html`<div class="ui5-tli-dummy-icon-container"></div>`; };
const block3 = (context) => { return html`${ context.nameClickable ? block4(context) : block5(context) }`; };
const block4 = (context) => { return html`<${scopeTag("ui5-link", tags, suffix)} @click="${context.onNamePress}" class="ui5-tli-title-name-clickable">${ifDefined(context.name)}&nbsp;</${scopeTag("ui5-link", tags, suffix)}>`; };
const block5 = (context) => { return html`<span class="ui5-tli-title-name">${ifDefined(context.name)}&nbsp;</span>`; };
const block6 = (context) => { return html`<div class="ui5-tli-desc"><slot></slot></div>`; };


	return block0(context);
};

export default main;
